import React from "react";
import classes from './profile.module.css';

function Profile() {
   return (
      <div className={classes.content}>
        <div>
          <img className={classes.img} src="https://static.rcvostok.ru/images/brands/f91f5af39ce347afab47ccb7d8fadacf.png"></img>
        </div>
        <div className={classes.post}>ava+des</div>
        <div className={classes.post}>
          my posts
          <div className={classes.area}>new post</div>
          <div className={classes.posts}>
            <div className={classes.post}>post1</div>
            <div className ={classes.post}>post2</div>
          </div>
        </div>
      </div>
   )
}

export default Profile;
